import React, { Component } from 'react';
class SearchResult extends Component {
    state = {  }
    render() { 
        return ( <div className="gozareshat-bg p-3 col-lg-10">
        <div className="w-100 form-box">
          <h6>برای جستجوی کنتور مورد نظر شناسه کنتور را وارد کنید.</h6>
          <form
            onSubmit={this.handleSubmit}
            id="mainInput"
            className="form-inline my-2 my-lg-0 search-form"
          >
            <input
              className="form-control mr-sm-2 "
              value={this.state.searchText}
              onChange={this.handleChange}
              type="number"
              placeholder="شماره شناسه کنتور..."
              aria-label="Search"
              required
            />

            <button
              className="btn btn-outline-success my-2 my-sm-0"
              type="submit"
            >
              جستجو
              <SearchIcon />
            </button>
          </form>
        </div>
        <div className="list-box" id="style-7">{this.renderList()}</div>
      </div> );
    }
}
 
export default SearchResult;
